import { useState } from "react";
import "./App.css";
import { Welcome } from "./components/welcome";
import { LandingPage } from "./components/landingPage";

function App() {
  const [welcome, showWelcome] = useState(true);
  return (
    <div className="App">
      {welcome ? <Welcome /> : <LandingPage />}
    </div>
  );
}

export default App;
